import { BrowserRouter, Switch } from "react-router-dom";
import Routes from "../src/routes/routes";

export default function index() {
  return (
    <BrowserRouter>
      <Switch>
        <Routes></Routes>
      </Switch>
    </BrowserRouter>
  );
}
